import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Login = () => {
  const navigate = useNavigate();

  const handleLogin = (e) => {
    e.preventDefault();
    // Fake authentication (Replace with API call)
    navigate("/dashboard");
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient">
      <div className="bg-gray-900 p-8 rounded-lg shadow-lg max-w-md w-full">
        <h2 className="text-3xl font-bold text-center text-white">Login</h2>
        <form className="mt-6" onSubmit={handleLogin}>
          <label className="block mb-2 text-gray-300">Email</label>
          <input type="email" className="w-full p-3 rounded-lg bg-gray-800 text-white focus:ring-2 focus:ring-primary" required />

          <label className="block mt-4 mb-2 text-gray-300">Password</label>
          <input type="password" className="w-full p-3 rounded-lg bg-gray-800 text-white focus:ring-2 focus:ring-primary" required />

          <button type="submit" className="w-full mt-6 bg-primary hover:bg-secondary text-white py-3 rounded-lg font-bold transition">
            Sign In
          </button>
        </form>
        <p className="mt-4 text-center">
          Don't have an account? <Link to="/signup" className="text-accent hover:underline">Sign up</Link>
        </p>
      </div>
    </div>
  );
};

export default Login;
